import React from "react";
import { Link } from "react-router-dom";
const Profile = () => {
  return (
    <div>
      <div class="navbar">
        <div class="home">
          <Link to="/" className="mlny">
            <i class="fa fa-home" />
          </Link>
          <h3>Home</h3>
        </div>

        <div class="notifications">
        <Link to="/" className="mlny">
            <i class="fa fa-bell-o" />
          </Link>
          <h3>notifications</h3>
        </div>

        <div class="search"></div>
        <h3>search</h3>

        <div class="logout"></div>
        <h3>Logout</h3>

        <div class="user">
        <Link to="/" className="mlny">
            <i class="fa fa-user" />
          </Link>
          <h3>toni</h3>
        </div>
      </div>

      <section>
        <div
          style="
        width: 258px;
        height: 488px;
        background-color: rgba(196, 196, 196, 1);
      "
        />
        <p
          style="
        font-size: 24px;
        font-weight: 700;
        line-height: 100%;
        color: black;
      "
        >
          Schedule
        </p>
        <p
          style="
        font-size: 24px;
        font-weight: 700;
        line-height: 100%;
        color: black;
      "
        >
          Add Session
        </p>
        <p
          style="
        font-size: 24px;
        font-weight: 700;
        line-height: 100%;
        color: black;
      "
        >
          Students
        </p>
        <p
          style="
        font-size: 24px;
        font-weight: 700;
        line-height: 100%;
        color: black;
      "
        >
          Announcements
        </p>
      </section>

      <div class="hero"></div>

      <div class="footer">
        <h1>Privacy Policy</h1>
      </div>
    </div>
  );
};

export default Profile;
